import{_ as e,c as o,o as c,V as t}from"./chunks/framework.heQuCCy3.js";const s="/docs/assets/pS1rbgP.a-8ULw-j.png",a="/docs/assets/pS128NF.FwRTK0ah.png",d="/docs/assets/pS12dnx.1ISVa_kh.png",i="/docs/assets/pS12s4e.lvZTYtzv.png",r="/docs/assets/pS12ggA.T_oY2v5p.png",v=JSON.parse('{"title":"代码生成","description":"","frontmatter":{},"headers":[],"relativePath":"server/code-generate.md","filePath":"server/code-generate.md","lastUpdated":1705459633000}'),l={name:"server/code-generate.md"},n=t('<h1 id="代码生成" tabindex="-1">代码生成 <a class="header-anchor" href="#代码生成" aria-label="Permalink to &quot;代码生成&quot;">​</a></h1><p><strong>代码生成</strong> 真的是每个项目都必备的了！代码生成一般都是为了减少<code>curd</code>的重复工作。因为后台管理的<code>curd</code>真的是必备的，所以代码生成还是很有必要的。因为是前后端分离项目，所以一般代码生成之后不会立刻看到页面，分两种情况</p><ul><li>如果使用的动态菜单，即开启了权限管理的情况下，那么就需要添加动态菜单</li><li>只需要静态菜单，在约定的<code>章节</code>可以了解到，需要在模块的 <code>views/route.js</code> 文件添加前端路由</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>视频教程地址<a href="https://www.bilibili.com/video/BV1Qh4y1J7eB/" target="_blank" rel="noreferrer">catchadmin 之快速开发</a></p></div><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><p>众所周知，<code>CatchAdmin</code> 是模块化的，那么首先需要干什么呢？没错，就是新增模块。如下图所示 <img src="'+s+'" alt="pS1rbgP.png"> 点击新增按钮，按照提示信息输入模块信息，然后点击创建模块。</p><p>模块创建完成之后，然后在创建 <code>Schema</code>，如下图 <img src="'+a+'" alt="pS128NF.png"> 按照提示填写表信息，然后点击下一步 <img src="'+d+'" alt="pS12dnx.png"> 如图，需要在这里添加表字段，完成之后，点击创建即可。如下图 <img src="'+i+'" alt="pS12s4e.png"> 生成代码是通过每个<code>Schema</code>进行，点击生成代码按钮，进入代码生成页面 <img src="'+r+'" alt="pS12ggA.png"> 生成代码页面有几个比较重要的参数</p><ul><li><code>模块</code> 是必选的</li><li><code>控制</code> 器名称是必填的</li><li><code>模型名称</code> 是默认使用表名称</li><li><code>表单 label</code> 是对应表单字段名称</li><li><code>列表</code> 是指字段是否展示在列表中</li><li><code>表单</code> 是指字段是否应用在表单中，这个字段也会同时写入到模型的 <code>form</code> 属性</li><li><code>查询</code> 是指字段是否应用在列表的搜索</li><li><code>验证规则</code> 不是应用于前端，而是后端进行字段验证</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>在填写好菜单之后，可以立即看到页面，也会自动生成基本的 curd 菜单</p></div>',9),p=[n];function _(m,g,h,u,S,f){return c(),o("div",null,p)}const k=e(l,[["render",_]]);export{v as __pageData,k as default};
